function asyncify (fnSync, callback) {
  return (...args) => {
    return new Promise((resolve, reject) => {
      // TODO: Zalgo? process.nextTick()?
      let result
      try {
        result = fnSync(...args)
      } catch (error) {
        callback(error)
        return reject(error)
      }
      callback(null, result)
      resolve(result)
    })
  }
}

